import React, { Component } from "react";

export class Category extends Component {
  constructor(props) {
    super(props)
    this.state = {
      categiries: [
        { key: "all", name: "Всё" },
        { key: "chairs", name: "Стулья" },
        { key: "tables", name: "Столы" },
        { key: "sofa", name: "Диваны" },
        { key: "light", name: "Свет" }
      ],
    };
  }
  render() {
    return <div className="categories">{this.state.categories.map(el=>(
        <div key={el.key}>{el.name}</div>
    ))}</div>;
  }
} 

export default Category;
